import React from "react";
import backgroundVideo from "../../Assets/water-background.mp4";
import profilePicture from "../../Assets/profilePicture.jpeg";
import "./Homepage.css";

class Homepage extends React.Component {
    render() {
        return (
            <div id="homepageContainer">
                <video autoPlay muted loop id="backgroundVideo">
                    <source src={backgroundVideo} type="video/mp4" />
                </video>
                <div className="homepageContentContainer">
                    <img src={profilePicture} id="profilePicture" />
                    <p className="whiteText">Lorem ipsum blah blah blah blah blah blah blah blah blah blah blah blah blah blah</p>
                </div>
                
            </div>
        );
    }
}

export default Homepage;
